description:
Promotional info for the collected edition - &quot;The most imaginative, groundbreaking comic of 2005! International bestseller, four-time Hugo award, two-time Nebula award and World Fantasy Award winner Orson Scott Card (author of Ender's Game, Speaker for the Dead, Shadow Puppets) comes to the Ultimate Universe. He's joined by industry legend Andy Kubert (Ultimate X-Men, Marvel 1602, Wolverine: Origin) to show the shocking beginning of Ultimate Iron Man! If you thought The Ultimates told you everything you needed to know about Ultimate Iron Man, think again! &quot;

Thanks to Zone-Empire for these digital copies. Please seed and enjoy.

